const $ = document.querySelector.bind(document);
const $$ = document.querySelectorAll.bind(document);
const playListSongs = $('.songs');
let indexSong = 0;
let currentSong = songs[indexSong];
const audio =$('#audio');

function start() {
    render();
    loadingSong();
    handleEvents();
    activeSong();
}
start();

function render() {
    const htmls = songs.map(song => {
        return `
        <div class="song">
        <div class="thumb" style="background-image: url(${song.image})">
        </div>
        <div class="body">
          <h3 class="title">${song.name}</h3>
          <p class="author">${song.singer}</p>
        </div>
        
      </div>
        `
    })
    playListSongs.innerHTML = htmls.join('');
}

function loadingSong() {
    const cdImage = $('.art');
    const heading = $('.info h1');
    const title = $('.info p');
    const audio = $('#audio');
    cdImage.src = currentSong.image;
    heading.innerText = currentSong.name;
    title.innerText = currentSong.singer;
    audio.src = currentSong.path;

}

function handleEvents() {
    //playing song
    isPlaying = false;
    const playBtn = $('.playing-btn');
    playBtn.onclick = function() {
        if(isPlaying) {
            audio.pause();
        } else {
            audio.play();
        }
    }
    audio.onplay = function() {
        playBtn.classList.add('active');
        audio.play();
        isPlaying = true;
        cdRotate.play();
    }
    audio.onpause = function() {
        playBtn.classList.remove('active')
         isPlaying = false;
         cdRotate.pause();
    }

    //Next song
    const nextBtn = $('.next-button');
    nextBtn.onclick = function() {
        if(isRandom) {
            indexSong = Math.floor(Math.random()* songs.length)
        } else {
            indexSong++;
            if(indexSong >= songs.length) {
            indexSong = 0;
        }
        }
        
        currentSong = songs[indexSong];
        loadingSong();
        audio.play();
        activeSong();

    }
    //Prev song
    const prevBtn = $('.prev-btn');
    prevBtn.onclick = function() {
        if(isRandom) {
            indexSong = Math.floor(Math.random()* songs.length)
        } else {
        indexSong--;
        if(indexSong < 0) {
            indexSong = songs.length - 1;
        }
        }
        currentSong = songs[indexSong];
        loadingSong();
        audio.play();
        activeSong();

    }

    //Repeat song
    isRepeat = false;
    const repeatBtn = $('.repeat-btn');
    repeatBtn.onclick = function() {
        repeatBtn.classList.toggle('active');
        isRepeat = !isRepeat;
    }

    //Ending song
    audio.onended = function() {
        if(isRepeat) {
            audio.play();
        } else {
            nextBtn.click();
        }
    }

    //Time lining
    const progressBar = $('.prog-bar-inner');
    audio.ontimeupdate = function() {
        if(audio.duration) {
            const progress = Math.floor(audio.currentTime / audio.duration * 100);
             progressBar.value = progress;
        }
        $('.left').innerText = timerFormat(audio.currentTime);
    }

    //Time next
    progressBar.oninput = function() {
        audio.currentTime = Math.floor(progressBar.value / 100 * audio.duration);
    }

    //Random song
    isRandom = false;
    const randomBtn = $('.random-btn');
    randomBtn.onclick = function() {
        randomBtn.classList.toggle('active');
        isRandom = !isRandom;
    }

    //cd rotate
    const cdThumb = $('.art');
    const cdRotate = cdThumb.animate([{
        transform: 'rotate(360deg)'
    }], {
        duration: 10000,
        iterations: Infinity,
    })
    cdRotate.pause();

    //display list-song
    const playList = $('.play-list');
    const listSong = $('.list-songs');
    listSong.onclick = function() {
        playList.style.display = 'block';
        scrolling();

    }

    //close list-song
    const closeBtn = $('.play-list-close');
    closeBtn.onclick = function() {
        playList.style.display = 'none';
    }

    //active song
    const listOfSong = $$('.song');
    listOfSong.forEach((song, index) => {
        song.onclick = function() {
           listOfSong.forEach(song => {
            if(song.classList.contains('active')) {
                song.classList.remove('active')
            }
           })
           if(!song.classList.contains('active')) {
            song.classList.add('active');
            currentSong = songs[index];
            loadingSong();
            audio.play();
        }
        }
    })
    //timer
    audio.onloadedmetadata = () => {
        $('.right').innerText = timerFormat(audio.duration);
     }

     //volume 
     const volumeBtn = $('.bar');
     volumeBtn.oninput = function() {
        audio.volume = volumeBtn.value / 100;
        $('.volume-icon').style.display = 'block';
     }
     setInterval(() => {
        $('.volume-icon').style.display = 'none';

     },3000)
}

 function activeSong() {
     const listOfSong = $$('.song');
     listOfSong.forEach((song,index) => {
        if(index === indexSong) {
            song.classList.add('active');
        } else {
            song.classList.remove('active');
        }
     })
 }
 function scrolling() {
    const activedSong = $('.song.active');
    setTimeout(() => {
        activedSong.scrollIntoView({
            behavior: 'smooth',
            block: 'center',
        })
    }, 300)
 }
 //timer
 function timerFormat(duration) {
    const rounded = Math.floor(duration);
    return `${Math.floor(rounded/60) >= 10 ? Math.floor(rounded/60) : '0' + Math.floor(rounded/60)}:${rounded%60 >= 10 ? rounded%60 : '0' + rounded%60}`;
 }
 

